func generateLeaderboardCaption(p LeaderboardProps) string {
	base := p.SelectedKind.Display
	for _, char := range p.CharacterOptions {
		if char.Selected {
			base += " - " + char.Display
			break
		}
	}
	for _, month := range p.MonthOptions {
		if month.Selected {
			base += " - " + month.Display
			break
		}
	}
	return base
}

